import React, { Component } from 'react'
import qualityImg from './images/quality.jpg';

export default class BasketNav extends Component {
    render() {
        return (
            <div className="basket-session container-fluid">
                <div className="nav d-flex justify-content-between align-items-center bg-dark text-light">
                    <div className="title">Smart Resto</div>
                    <div className="steps"></div>
                    <div className="quality">
                        <img src={qualityImg} alt="" />
                    </div>
                </div>
            </div>
        )
    }
}
